import React from 'react';

function Footer() {

    return (
        <footer>
            <div class="container">
                <div class="links">
                <a href="https://github.com/shannonjburris" target="_blank" rel="noreferrer"><i class="fab fa-github"></i></a>
                </div>
            </div>
            <div class="container">
                <ul class="contact-links">
                    <li> <a href="tel:863-255-6043">863-255-6043</a> </li>
                    <li> <a href="mailto:shannonjburris@gmail.com" target="_blank" rel="noreferrer">shannonjburris@gmail.com</a> </li>
                    <li> <a href="https://github.com/shannonjburris" target="_blank" rel="noreferrer">GitHub</a> </li>
                    <li> <a href="https://www.linkedin.com/in/shannon-burris/" target="_blank" rel="noreferrer">Linkedin</a></li>
                    <li> <iframe src="https://api.badgr.io/public/assertions/h4SuODmWReqmhOYL60Azbw?embedVersion=1&amp;embedWidth=330&amp;embedHeight=186&amp;identity__email=shannonjburris%40gmail.com" title="Badge: UCF Coding Boot Camp (Full-Stack Web Development)[Full-Time]" style="width: 330px; height: 186px; border: 0px;"></iframe> </li>
                </ul>
            </div>
        </footer>

    )
};

export default Footer;
